Most tutorials, books and educational resources about C++ seem to encourage use of using namespaces std; at the top of your code. This allows you to omit writing std:: before every type, which reduces keystrokes. import <iostream> using namespace std; // No!!! int main() { cout << "Hello World\n";
} However, in practice this is not a good idea . This effectively dumps every single name from their home in std into the global scope, and std is a huge namespace. This will introduce hundreds of names for potential name collision errors, including commonly used names like max, min and equal. This turns your code into a ticking time bomb, because while it might work just fine for now, importing a header can introduce a bunch of new names, causing collisions and breaking the code in confusing ways. An alternative to this is to do using only on specific names you want to include. However, I am personally not a fan of that style. import <iostream> using std::cout; // Fine, but I don't recommend it int main() { cout << "Hello World\n";
}
